Описание:
Продам земельный участок площадью 1 Га (10182 м2).
ОД 2.
Для понимания размера участка, скажу что продуктовый рынок Союз Оптовиков, расположенный на ул. 30 лет победы, занимает чуть большую площадь.
Кадастровый номер добавим в ближайшее время, пока идёт работа по формированию этого участка.
Участок расположен по ул. Профсоюзов справа от Азс Башнефтепродукт.

Информация  о видах разрешённого использования земельного участка:

Бытовое обслуживание;
Общественное управление;
Деловое управление;
Банковская и страховая деятельность;
Объекты торговли (торговые центры, торгово-развлекательные центры (комплексы);
Рынки;
Магазины;
Общественное питание;
Гостиничное обслуживание;
Социальное обслуживание;
Культурное развлечение;
Развлекательные мероприятия;
Земельные учётки (территории) общего пользования.

Условно разрешённые виды использования земельного участка:

Лёгкая промышленность;
Пищевая промышленность;
Строительная промышленность;
Склады.

